import React from 'react'
import event from './images/events.jpeg'

const Event1 = () => {
    const headerStyle = {
        backgroundImage: `url(${event})`,
        backgroundSize: '1297px',
        backgroundAttachment: 'fixed',
        height: '60vh',
        width: '100%',
        position: 'relative',
    };

    
     
    const styles = {
        container: {
          textAlign: 'center',
          paddingTop: '40px',
        },
        heading: {
          fontSize: '32px',
          fontWeight: 'bold',
        },
        bulletPoints: {
          listStyleType: 'none',
          padding: '0',
          marginTop: '20px',
        },
      };



    return (
        <>
    <header style={headerStyle}>
      <h1 style={headingStyle}></h1>
    </header>

<div className="container">
<h1 className="heading">Events</h1>
<ul className="bullet-points">
  <li>Event 1</li>
  <li>Event 2</li>
  <li>Event 3</li>
  <li>Event 4</li>
</ul>
</div>
</>
    )
}

export default Event1
